import { Navbar } from "../components";
import { useSelector } from "react-redux";

const Upload = () => {
    const { auth } = useSelector(state=>state);

    return (
        <div className="w-full bg-gray-100 min-h-screen">
            <Navbar/>
            <div className="w-[50vw] py-5 mt-10 px-5 mx-auto bg-white rounded-lg">
                <label className="bg-gray-100 rounded-lg w-[48%] h-[300px] flex justify-center items-center">
                <i className="ri-image-add-line text-5xl text-gray-500"></i>
                </label>
                <form className="w-[48%]"></form>
            </div>
        </div>
    )
}

export default Upload;
